import React from 'react';
import {connect} from 'react-redux';
import { Field, reduxForm } from 'redux-form';

class FormCourse extends React.Component {
    componentDidMount() {

    }

    render() {
        //onSubmit={this.props.handleSubmit(this.onSubmit)}
        return (
            <form className="ui form error">
                <Field name="title" component={this.renderInput} label={<p className="label">Enter Title</p>} />
                <Field name="description" component={this.renderInput} label={<p className="label">Enter Description</p>} />
                <FormProvider value={this.state.showError}>
                    <FileUpload data={{ linkChanger: this.changeLink.bind(this)}} />
                </FormProvider>
                <button className="ui button primary">Submit</button>
            </form>
        );
    }
}

const validate = (formValues) => {
    const errors = {};
    return errors;
};

export default reduxForm({
    form: 'DocumentForm',
    validate
})(FormCourse);
